import React from "react";
import SubscriptionPlan from "./components/SubscriptionPlan";
import "./SubscriptionPlans.css";


const SubscriptionPlans = () => {
  // Defina os dados para cada plano de assinatura
  const plans = [
    {
      id: 1,
      name: "Basic",
      price: "$9.99",
      features: ["1 Tela", "Qualidade SD"],
    },
    {
      id: 2,
      name: "Standard",
      price: "$13.99",
      features: ["2 Telas", "Qualidade HD"],
    },
    {
      id: 3,
      name: "Premium",
      price: "$17.99",
      features: ["4 Telas", "Qualidade Ultra HD", "HDR"],
    },
  ];

  return (
    <div className="subscription-plans-container">
      {/* Mapeie os dados de cada plano de assinatura e renderize um componente SubscriptionPlan para cada um */}
      {plans.map((plan) => (
        <SubscriptionPlan key={plan.id} plan={plan} />
      ))}
    </div>
  );
};

export default SubscriptionPlans;
